import React from "react";
import { Link } from "react-router-dom";

const ListItem = ({ note }) => {

  let getTitle = ()=>{

    let title = note.body.split('\n')[0]

    return title
  }
  return (
    <Link to={`/note/${note.id}`}>
      <div className="notes-list-item">
        <h3>{note.body}</h3>
      </div>
    </Link>
  );
};

export default ListItem;
